function Getlist(props){
//console.log(props)

 const {userList} =props
console.log(userList)

 

return(
    <div>
        <h1>pagina: {props.currentPage}</h1>
        <button onClick={props.nexthandle}>next</button>
        <button onClick={props.prevhandle}>prev</button>

        <h2>items</h2>
        <ul>
        {userList.map(({ name, idSap }, index) => {
                return (
                  <Form.Check
                    key={index}
                    inline
                    onClick={handletipologia}
                    onChange={handleCheck}
                    label={name}
                    name={name}
                    //type={type}
                    value={checked}
                    id={`${idSap}`}
                  />
                );
              })}
        </ul>
    </div>
)
}

export default Getlist
